import MovieList from "./MovieList";
import useFetch from "./useFetch";

const Home = () => {
  const { error, isPending, data: movies } = useFetch('http://localhost:8000/blogs')

  return (
    <div className="home">
      { error && <div>{ error }</div> }
      { isPending && <div>Loading...</div> }
      { movies && <MovieList blogs={blogs} /> }
    </div>
  );
}
 
export default Home;
